@Component({
  selector: 'app-nav',
  templateUrl: './nav.component.html',
  styleUrls: ['./nav.component.css']
})
export class NavComponent {

}
<nav>
    <ul>
        <li><a routerLink="/">Home</a></li>
        <li><a routerLink="/libros">Home</a></li>
        <li><a routerLink="/">Home</a></li>
    </ul>
</nav>
